import React, { useState } from 'react';
import { 
  Upload,
  FileText,
  AlertTriangle,
  CheckCircle,
  Clock,
  Eye,
  Edit,
  X,
  Plus,
  Play,
  Download,
  Search,
  Database,
  TrendingUp,
  RefreshCw
} from 'lucide-react';
import { 
  BarChart, 
  Bar, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  ResponsiveContainer,
  LineChart,
  Line,
  PieChart,
  Pie,
  Cell
} from 'recharts';

interface CartCode {
  id: string;
  claimId: string;
  patient: string;
  service: string;
  payer: string;
  cartCode: string;
  denialReason: string;
  status: string;
  submittedDate: string;
  priority: string;
  amount: number;
  assignedTo?: string;
  notes?: string;
  lastUpdated: string;
}

const CartCodeManagement: React.FC = () => {
  const [selectedStatus, setSelectedStatus] = useState<string>('all');
  const [selectedPayer, setSelectedPayer] = useState<string>('all');
  const [selectedPriority, setSelectedPriority] = useState<string>('all');
  const [searchTerm, setSearchTerm] = useState<string>('');
  const [showCodeModal, setShowCodeModal] = useState<boolean>(false);
  const [selectedCode, setSelectedCode] = useState<CartCode | null>(null);
  const [showImportModal, setShowImportModal] = useState<boolean>(false);
  const [showExportModal, setShowExportModal] = useState<boolean>(false);
  const [exportFormat, setExportFormat] = useState<string>('csv');
  const [isProcessing, setIsProcessing] = useState<boolean>(false);
  const [processingProgress, setProcessingProgress] = useState<number>(0);

  // Mock data for 835s and CART code management
  const cartCodeData: CartCode[] = [
    {
      id: 'CART-001',
      claimId: 'CLM-2024-001234',
      patient: 'John Smith',
      service: 'Physical Therapy',
      payer: 'Blue Cross Blue Shield',
      cartCode: 'CART-001',
      denialReason: 'Missing authorization',
      status: 'pending',
      submittedDate: '2024-01-15',
      priority: 'high',
      amount: 1250,
      assignedTo: 'Sarah Johnson',
      notes: 'Need to contact provider for authorization details',
      lastUpdated: '2024-01-15 14:30'
    },
    {
      id: 'CART-002',
      claimId: 'CLM-2024-001235',
      patient: 'Sarah Johnson',
      service: 'Occupational Therapy',
      payer: 'Aetna',
      cartCode: 'CART-002',
      denialReason: 'Invalid diagnosis code',
      status: 'in_progress',
      submittedDate: '2024-01-14',
      priority: 'medium',
      amount: 850,
      assignedTo: 'Mike Wilson',
      notes: 'Diagnosis code needs to be updated',
      lastUpdated: '2024-01-15 10:15'
    },
    {
      id: 'CART-003',
      claimId: 'CLM-2024-001236',
      patient: 'Mike Wilson',
      service: 'Speech Therapy',
      payer: 'Cigna',
      cartCode: 'CART-003',
      denialReason: 'Timely filing exceeded',
      status: 'resolved',
      submittedDate: '2024-01-13',
      priority: 'low',
      amount: 1100,
      assignedTo: 'Lisa Brown',
      notes: 'Resolved with appeal',
      lastUpdated: '2024-01-14 16:45'
    },
    {
      id: 'CART-004',
      claimId: 'CLM-2024-001237',
      patient: 'Lisa Brown',
      service: 'Physical Therapy',
      payer: 'UnitedHealth',
      cartCode: 'CART-004',
      denialReason: 'Missing documentation',
      status: 'pending',
      submittedDate: '2024-01-12',
      priority: 'high',
      amount: 950,
      assignedTo: 'Robert Chen',
      notes: 'Waiting for medical records',
      lastUpdated: '2024-01-15 09:20'
    }
  ];

  const cartCodeTrends = [
